// src/App.js
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import SimpleQuestion from "./SimpleQuestion";
import CompatibilityTab from "./CompatibilityTab";
import "./App.css";

function App() {
  return (
    <Router>
    <div className="App">
      <img src={Logo} className="App-logo" alt="logo/"/>
      <h1>Voiance</h1>
          <nav>
            <ul>
              <li>
                <Link to="/">Accueil</Link>
              </li>
              <li>
                <Link to="/CompatibilityTab">Compatibilit√©</Link>
              </li>
              <li>
                <Link to="/simple-question">Question simple</Link>
              </li>
            </ul>
          </nav>
          <Routes>
            <Route path="/CompatibilityTab" element={<CompatibilityTab />} />
            <Route path="/SimpleQuestion" element={<SimpleQuestion />} />
          </Routes>
      </div>
    </Router>
  );
}

export default App;
